const message = ref('');

function restoreLocalStorageFromObject() {
    if (!backupText.value || typeof backupText.value !== 'object') {
        message.value = ' backupText không phải object hợp lệ!';
        return;
    }

    let count = 0;
    for (const key of Object.keys(backupText.value)) {
        let value = backupText.value[key];

        // nếu còn là object -> stringify lại (giống localStorage thật)
        if (typeof value === 'object') {
            value = JSON.stringify(value);
        }

        localStorage.setItem(key, value);
        count++;
    }

    message.value = `ngon chim`;
    startCountdownAndReload(5)
}

/// làm  bộ đếm ngược
const countdown = ref(0)

// bộ đếm ngưuoc 
function startCountdownAndReload(seconds = 5) {
    countdown.value = seconds;

    const timer = setInterval(() => {
        countdown.value = countdown.value - 1;
        if (countdown.value <= 0) {
            clearInterval(timer);

            window.location.reload();
        }
    }, 1000);
}
